import "./App.css";
import Home from "./components/Home/Home";
//import styled from "styled-components";
import { Router } from "react-router-dom";

class App extends Component {
  render() {
    return (
      <div className="main-container">
        <Home />
      </div>
    );
  }
}

export default App;

